export default function Body() {
    return (
        <div style={{
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-around",
            alignItems: "center",
            padding: "20px",
            backgroundColor: "#f5f5f5"
        }}>
            <div style={{
                width: "80%",
                height: "400px",
                backgroundColor: "white",
                marginRight: "20px",
                marginLeft: "50px",
                marginTop: "20px"

            }}>
                <div style={{
                    padding: "20px"
                }}>
                    <div style={{
                        display: "flex",
                        flexDirection: "row",
                        justifyContent: "space-between",
                        alignItems: "center",
                    }}>
                        <h1>Eğitimler</h1>
                        <h1>5</h1>
                    </div>

                </div>
            </div>
            <div style={{
                width: "20%",
                height: "400px",
                backgroundColor: "white"
            }}>
                Kutu 2
            </div>
        </div>
    );
}
